import React from "react";
import "./styles.css"

const buttonA = <button>Histórico</button>
const buttonB = <button>Cadastrar</button>

const hasCostumer = true;

const App = () => {

    const renderShowHistory = ()=>{
        <div>
        Veja o histórico<br/>
        {buttonA}   
        </div>
    }


    const renderAddCostumer = ()=>{
        <div>
           Cadastre-se <br/> {buttonB}
        </div>

    }


    return (
        <div>
            <p>Digital Inovation One</p>
            <p>Hello World</p>
            {hasCostumer ? renderShowHistory() : renderAddCostumer()}
        </div>
    );
};

export default App;
